def predict_with_simi(test_symp):


    count_disease_with_simi = {}

    for key, i in main_info.items():
        sm = difflib.SequenceMatcher(None,test_symp,i)
        count_disease_with_simi[key] = sm.ratio()

    sorted_d = dict( sorted(count_disease_with_simi.items(), key=operator.itemgetter(1), reverse=True))
